    /// <summary>
    /// Provides extension methods for <see cref="Exception"/>.
    /// </summary>
    public static class ExceptionExtensions
    {
        /// <summary>
        /// Converts this <see cref="Exception"/> to a <see cref="HRESULT"/>.
        /// </summary>
        /// <param name="ex">The exception.</param>
        /// <returns>The <see cref="HRESULT"/> created from the <see cref="Exception"/> <paramref name="ex"/>.</returns>
        public static HRESULT ToHResult(this Exception ex) => (HRESULT)ex.HResult;
    }

    /// <summary>
    /// Provides extension methods for <see cref="Enum"/>.
    /// </summary>
    public static class EnumExtensions
    {
        /// <summary>
        /// Gets a list of values that were combined for an enum with the <see cref="FlagsAttribute">[Flags] attribute</see>.
        /// </summary>
        /// <param name="e">The enum.</param>
        /// <returns>The list of combined values that were making up the Enum.</returns>
        public static IEnumerable<Enum> GetValues(this Enum e)
        {
            ulong longValue = Convert.ToUInt64(e);
            foreach (Enum flag in Enum.GetValues(e.GetType()))
            {
                ulong flagValue = Convert.ToUInt64(flag);
                if (flagValue != 0 && (longValue & flagValue) == flagValue)
                {
                    yield return flag;
                }
            }
        }
    }

