    /// <summary>
    /// Adds extension methods to the <see cref="Icon"/> class.
    /// </summary>
    public static class IconExtensions
    {
        /// <summary>
        /// Destroys the icon's GDI handle.
        /// </summary>
        /// <param name="icon">The icon whose handle is to be destroyed.</param>
        /// <returns><see langword="true"/> if successful; otherwise, <see langword="false"/>. To get extended error
        /// information, call <see cref="Marshal.GetLastPInvokeError"/>.</returns>
        public static bool Destroy(this Icon icon) => Shell32.DestroyIcon(icon.Handle);
    }
